  width: 100%;
  height: 100%; }

/* ------------------------------------ *  $COMPONENTS
\* ------------------------------------ */
/**
 * WordPress Generated Classes
 * @see http://codex.wordpress.org/CSS#WordPress_Generated_Classes
 */
/** Media alignment */
.alignnone {
  margin-left: 0;
  margin-right: 0;
  max-width: 100%;
  height: auto; }

.aligncenter {
  display: block;
  margin: 0.5em auto;
  height: auto; }

.alignleft,
.alignright {
  margin-bottom: 0.5em;
  height: auto; }

@media (min-width: 30rem) {
  .alignleft {
    float: left;
    margin-right: 0.5em; }
  .alignright {
    float: right;
    margin-left: 0.5em; } }

/** Captions */
/** Text meant only for screen readers */
.screen-reader-text {
  position: absolute;
  width: 1px;
  height: 1px;
  padding: 0;
  margin: -1px;
  overflow: hidden;
  clip: rect(0, 0, 0, 0);
  border: 0;
  color: #000;
  background: #fff; }

.img-container {
