/* ------------------------------------ *  $BASE
\* ------------------------------------ */

/* ------------------------------------ *    #BODY
\* ------------------------------------ */

/**
 * Body base styles
 */

body {
  background: white;
  color: #262626;
  font-family: AvenirNextLTPro-Regular, Arial, sans-serif;
  font-size: 1rem;
  line-height: 1.563rem;
  -webkit-text-size-adjust: 100%;
  min-height: 100vh;
  display: flex;
  flex-direction: column;
  margin: 0;
}

/* ------------------------------------ *    #TEXT
\* ------------------------------------ */

/*
 * Paragraph base styles
 */

p {
  margin: 0 0 1em;
  padding: 0;
}

/*
 * Header base styles
 */

h1 {
  font-family: PaulGroteskSoft-Bold, Arial, sans-serif;
  font-size: 1.953rem;
  line-height: 1.953rem;
  margin: 1.953rem 0;
  padding: 0;
}

h2 {
  font-family: AvenirNextLTPro-Demi, Arial, sans-serif;
  font-size: 1.563rem;
  line-height: 1.563rem;
  margin: 1.953rem 0 1.25rem;
  padding: 0;
}

h3 {
  font-family: AvenirNextLTPro-Demi, Arial, sans-serif;
  font-size: 1.25rem;
  line-height: 1.25rem;
  margin: 1rem 0;
  padding: 0;
}

h4,
h5,
h6 {
  font-family: AvenirNextLTPro-Demi, Arial, sans-serif;
  font-size: 1rem;
  margin: 1rem 0;
  padding: 0;
}

.brand {
  font-size: 6em;
}

/* ------------------------------------ *    #LINKS
\* ------------------------------------ */

/**
 * Links
 */

a {
  color: #396dff;
  text-decoration: none;
  outline: 0;
  transition: all 0.2s ease;
}

a:hover,
a:focus {
  color: #2ad891;
}

button,
.btn {
  font-size: 1rem;
  border: none;
}

.btn--rounded {
  border-radius: 0.64rem;
  padding: 0.8rem;
}

.btn__icon {
  padding: 1.25rem 2.441rem;
}

.btn.bg-brand-blue,
.login-form__form button.btn,
.btn.bg-brand-dark-gray,
.btn.bg-dark-blue,
.btn.bg-poppy,
.btn.bg-green,
.btn.bg-fuschia {
  color: white;
}

.btn.bg-brand-light-gray,
.btn.bg-yellow,
.btn.bg-white {
  color: #262626;
}

.btn.bg-brand-blue:hover,
.login-form__form button.btn:hover {
  background-color: #0647ff;
}

.btn.bg-brand-dark-gray:hover {
  background-color: #0d0d0d;
}

.btn.bg-brand-light-gray:hover {
  background-color: #d1d1d1;
}

.btn.bg-yellow:hover {
  background-color: #d4aa00;
}

.btn.bg-dark-blue:hover {
  background-color: #2c1f93;
}

.btn.bg-poppy:hover {
  background-color: #ff2b08;
}

.btn.bg-green:hover {
  background-color: #20af75;
}

.btn.bg-fuschia:hover {
  background-color: #e11887;
}

.btn.bg-white:hover {
  background-color: #e6e6e6;
}

img,
.img {
  object-fit: contain;
}

.img--full {
  width: 100%;
  height: 100%;
}

label {
  display: inline-block;
}

input[type="text"],
input[type="password"] {
  border-radius: 0.512rem;
  border: 1px solid #eaeaea;
  padding: 0.8rem;
  font-size: 1rem;
}

input[type="text"]::placeholder,
input[type="password"]::placeholder {
  color: #eaeaea;
}

input[type="text"]:focus,
input[type="password"]:focus {
  background-color: #262626;
  color: white;
  outline: none;
}

label {
  margin-right: 1rem;
}

.video__wrapper {
  position: relative;
  padding-bottom: 56.25%;
  /* 16:9 */
  padding-top: 25px;
  height: 0;
  margin: 1.25rem auto;
}

.video__wrapper iframe {
  position: absolute;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
}

/* ------------------------------------ *  $COMPONENTS
\* ------------------------------------ */

/**
 * WordPress Generated Classes
 * @see http://codex.wordpress.org/CSS#WordPress_Generated_Classes
 */

/** Media alignment */

.alignnone {
  margin-left: 0;
  margin-right: 0;
  max-width: 100%;
  height: auto;
}

.aligncenter {
  display: block;
  margin: 0.5em auto;
  height: auto;
}

.alignleft,
.alignright {
  margin-bottom: 0.5em;
  height: auto;
}

@media (min-width: 30rem) {
  .alignleft {
    float: left;
    margin-right: 0.5em;
  }

  .alignright {
    float: right;
    margin-left: 0.5em;
  }
}

/** Captions */

/** Text meant only for screen readers */

.screen-reader-text {
  position: absolute;
  width: 1px;
  height: 1px;
  padding: 0;
  margin: -1px;
  overflow: hidden;
  clip: rect(0, 0, 0, 0);
  border: 0;
  color: #000;
