/* ------------------------------------ *\
    #MODULAR SCALE
\* ------------------------------------ */

/*
 * Major 3rd scale based on http://www.modularscale.com/?1&em&1.25
 */

$ms-8: 5.96rem;
$ms-7: 4.768rem;
$ms-6: 3.815rem;
$ms-5: 3.052rem;
$ms-4: 2.441rem;
$ms-3: 1.953rem;
$ms-2: 1.563rem;
$ms-1: 1.25rem;
$ms-base: 1rem;
$ms--1: 0.8rem;
$ms--2: 0.64rem;
$ms--3: 0.512rem;
$ms--4: 0.41rem;
$ms--5: 0.328rem;
$ms--6: 0.262rem;
$ms--7: 0.21rem;
$ms--8: 0.168rem;

/* ------------------------------------ *\
    #COLORS
\* ------------------------------------ */

/*
 * 1) Color variables involve a two-tier system to keep colors in sync. The
 *    first tier defines the brand and neutral colors, and the second tier
 *    defines the application of those colors.
 */

/*
 * Primary & Secondary Colors
 * 1) Brand color variables use English names to define colors to make palettes easier to
 *    identify.
 * 2) Brand color variables should typically not be used directly in Sass partials. Instead, use
 *    second-tier application colors.
 *
 */
$color-brand-blue: rgb(57, 109, 255);
$color-brand-dark-gray: rgb(38, 38, 38);
$color-brand-light-gray: rgb(234, 234, 234);
$color-yellow: rgb(255, 206, 8);
$color-dark-blue: rgb(57, 40, 189);
$color-poppy: rgb(255, 87, 59);
$color-green: rgb(42, 216, 145);
$color-fuschia: rgb(235, 65, 159);
$color-white: rgb(255, 255, 255);

/*
 * Text Colors
 * 1) These are non-linked text colors, such as body copy.
*/
$color-text: $color-brand-dark-gray;
$color-text-light: $color-brand-light-gray;

/*
 * Heading Colors
 * 1) These are non-linked heading colors, such as h2, h3, etc.
 */
$color-heading: $color-brand-dark-gray;
$color-heading-light: $color-brand-light-gray;

/*
 * Text Link Colors
 * 1) These are for linked text, such as a link found within an article,
 *    navigation link, footer link, etc.
 */
