","/* ------------------------------------ *\
    #BODY
\* ------------------------------------ */

/**
 * Body base styles
 */
body {
  background: $color-white;
  color: $color-brand-dark-gray;
  font-family: $font;
  font-size: $ms-base;
  line-height: $ms-2;
  -webkit-text-size-adjust: 100%;
  min-height: 100vh;
  display: flex;
  flex-direction: column;
  margin: 0;
}
","/* ------------------------------------ *\
    #TEXT
\* ------------------------------------ */

/*
 * Paragraph base styles
 */
p {
  margin: 0 0 $space;
  padding: 0;
}

/*
 * Header base styles
 */
h1 {
  font-family: $font-paul;
  font-size: $ms-3;
  line-height: $ms-3;
  margin: $ms-3 0;
  padding: 0;
}

h2 {
  font-family: $font-demi;
  font-size: $ms-2;
  line-height: $ms-2;
  margin: $ms-3 0 $ms-1;
  padding: 0;
}

h3 {
  font-family: $font-demi;
  font-size: $ms-1;
  line-height: $ms-1;
  margin: $ms-base 0;
  padding: 0;
}

h4,
h5,
h6 {
  font-family: $font-demi;
  font-size: $ms-base;
  margin: $ms-base 0;
  padding: 0;
}

.brand {
  font-size: 6em;
}
","/* ------------------------------------ *\
    #LINKS
\* ------------------------------------ */

/**
 * Links
 */
a {
  color: $color-text-link;
  text-decoration: none;
  outline: 0;
  transition: all $anim-speed-02 $anim-ease;

  &:hover,
  &:focus {
    color: $color-text-link-hover;
  }
}
","button,
.btn {
  font-size: $ms-base;
  border: none;
}

.btn--rounded {
  border-radius: $ms--2;
  padding: $ms--1;
}

.btn__icon {
  padding: $ms-1 $ms-4;
}

.btn.bg-brand-blue,
.btn.bg-brand-dark-gray,
.btn.bg-dark-blue,
.btn.bg-poppy,
.btn.bg-green,
.btn.bg-fuschia {
  color: $color-white;
}

.btn.bg-brand-light-gray,
.btn.bg-yellow,
.btn.bg-white {
  color: $color-brand-dark-gray;
}

.btn.bg-brand-blue:hover {
  background-color: darken($color-brand-blue, 10);
}

.btn.bg-brand-dark-gray:hover {
  background-color: darken($color-brand-dark-gray, 10);
}

.btn.bg-brand-light-gray:hover {
  background-color: darken($color-brand-light-gray, 10);
}

.btn.bg-yellow:hover {
  background-color: darken($color-yellow, 10);
}

.btn.bg-dark-blue:hover {
  background-color: darken($color-dark-blue, 10);
}

.btn.bg-poppy:hover {
  background-color: darken($color-poppy, 10);
}

.btn.bg-green:hover {
  background-color: darken($color-green, 10);
}

.btn.bg-fuschia:hover {
  background-color: darken($color-fuschia, 10);
}

.btn.bg-white:hover {
  background-color: darken($color-white, 10);
}
","img,
.img {
  object-fit: contain;
}

.img--full {
  width: 100%;
  height: 100%;
}
","label {
  display: inline-block;
}

input[type="text"],
input[type="password"] {
  border-radius: $ms--3;
  border: 1px solid $color-brand-light-gray;
  padding: $ms--1;
  font-size: $ms-base;
}

input[type="text"]::placeholder,
input[type="password"]::placeholder {
  color: $color-brand-light-gray;
}

input[type="text"]:focus,
input[type="password"]:focus {
  background-color: $color-brand-dark-gray;
  color: $color-white;
  outline: none;
}
","label {
  margin-right: $ms-base;
}
",".video__wrapper {
  position: relative;
  padding-bottom: 56.25%; /* 16:9 */
  padding-top: 25px;
  height: 0;
  margin: $ms-1 auto;
}

.video__wrapper iframe {
  position: absolute;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
}
","/**
 * WordPress Generated Classes
 * @see http://codex.wordpress.org/CSS#WordPress_Generated_Classes
 */

/** Media alignment */
.alignnone {
  margin-left: 0;
  margin-right: 0;
  max-width: 100%;
  height: auto;
}

.aligncenter {
  display: block;
  margin: ($space / 2) auto;
  height: auto;
}

.alignleft,
.alignright {
  margin-bottom: ($space / 2);
  height: auto;
}

@media (min-width: 30rem) {
  .alignleft {
    float: left;
    margin-right: ($space / 2);
  }

  .alignright {
    float: right;
    margin-left: ($space / 2);
  }
}

/** Captions */

// TODO: .wp-caption {}
// TODO: .wp-caption img {}
// TODO: .wp-caption-text {}

/** Text meant only for screen readers */
.screen-reader-text {
  position: absolute;
  width: 1px;
  height: 1px;
  padding: 0;
  margin: -1px;
  overflow: hidden;
  clip: rect(0, 0, 0, 0);
  border: 0;
  color: #000;
  background: #fff;
}
",".img-container {
  object-fit: contain;
}

.img-container__main {
  margin-bottom: $ms-1;
  max-height: 100vh;
}

@media (min-width: $bp-med) {
  .img-container__main {
    padding: 0 $ms-3;
    border-right: 1px solid $color-brand-dark-gray;
  }
}
",".site-search {
  border: 1px solid $color-brand-light-gray;
  border-radius: $ms--3;
  position: relative;
  overflow: hidden;
}

.site-search input {
  border: none;
  border-right: 1px solid $color-brand-light-gray;
  border-radius: 0;
  width: calc(100% - #{$ms-5});
}

.site-search button {
  position: absolute;
  width: $ms-5;
  line-height: $ms-5;
  text-align: center;
  cursor: pointer;
  background-color: $color-white;
  border-radius: 0;
  color: $color-brand-blue;
  margin: 0;
  padding: 0;
}

.site-search button:focus {
  background-color: $color-brand-blue;
  color: $color-white;
  outline: 0;
}
",".mobile-nav {
  display: flex;
  flex-flow: row wrap;
  align-items: stretch;
  justify-content: space-between;
  flex-grow: 0;
  flex-shrink: 0;
  margin-bottom: $ms-1;
}

.mobile-nav .btn {
  flex-grow: 1;
  margin: $ms--2;
  border-radius: $ms--2;
  text-align: center;
}

.mobile-nav .btn .fa {
  vertical-align: text-top;
  font-size: $ms-1;
}

@media (min-width: $bp-med) {
  .mobile-nav {
    display: none;
  }
}
",".list-item {
  width: $col-12;
  list-style: none;
  border-radius: $ms--2;
  overflow: hidden;
  box-shadow: 0 4px 11px 0 rgba($color-brand-dark-gray, 0.5);
  margin: 0 $ms-base $ms-3;
  flex-grow: 0;
  flex-shrink: 0;
  position: relative;
  bottom: 0;
  cursor: pointer;
  transition: all $anim-speed-02 $anim-in-out;
}

.list-item:hover {
  bottom: $ms--8;
  box-shadow: 0 6px 20px 0 rgba($color-brand-dark-gray, 0.5);
}

.list-item a,
.list-item a:hover,
.list-item a:visited,
.list-item a:active {
  color: $color-brand-dark-gray;
}

.list-item__img {
  background-color: $color-brand-light-gray;
  width: 100%;
  height: calc(#{$ms-6} * 4);
  overflow: hidden;
  margin: 0 auto;
}

.list-item__info {
  position: relative;
}

.list-item__title {
  margin: $ms-1 $ms-2;
  text-align: center;
}

.list-item__info .fa {
  position: absolute;
  bottom: (-$ms--4);
}

.list-item__info .fa-folder {
  color: $color-brand-blue;
  left: $ms--1;
}

.list-item__info .fa-heart {
  color: $color-poppy;
  right: $ms--1;
}

@media (min-width: $bp-small) {
  .list-item__img {
    height: calc(#{$ms-6} * 6);
  }
}

@media (min-width: $bp-small-2) {
  .list-item {
    width: $col-6;
  }

  .list-item__img {
    height: calc(#{$ms-6} * 4);
  }
}

@media (min-width: $bp-small-3) {
  .list-item {
    width: $col-4;
  }

  .list-item__img {
    height: calc(#{$ms-6} * 3);
  }
}

@media (min-width: $bp-med) {
